import axios from 'axios'




function Weather() {

    const [danePogodowe, setDanePogodowe] = useEffect(null)

    useEffect(() => {

        const getData = () => {
            axios
                .get('https://danepubliczne.imgw.pl/api/data/synop/')
                .then((dane) => {
                    console.log(dane);
                    setDanePogodowe(dane)
                })
                .catch((error) => {
                    console.log(error)
                    console.log(error);
                    return null;
                })
        }
        getData();

    }, [])







    return (
        <div>

            <div>Dane pogodowe</div>
            <div>
                {
                    danePogodowe ? danePogodowe.map((miasto) => { return miasto.stacja }) : ("")



                }

            </div>
        </div>
    )
}

export default Weather
